import React, { useState } from "react";
import ReactDOM from "react-dom";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  Link,
} from "react-router-dom";

import './style.css';
import './style2.css';

import LoginP from './main/login';
import Main from './main/main';
  
const Home = () => {
  const navigate = useNavigate();

  const handleClick = () => {
      navigate("./main/login");
  }

  return (
      <div>
          <button onClick={handleClick} type="button">sss</button>
      </div>
  );
};
  
export default Home;
